import React from 'react'

export default function NavBar() {
  return (
    <div style={styles.listContainer}>
       <nav >
        <ul style ={styles.navList}>
            <li>
                Option1
            </li>
            <li>
                Option1
            </li>
            <li>
                Option1
            </li>
        </ul>
       </nav>
    </div>
  )
}
const styles = {
listContainer:{
  flex:1,
  flexDirection:'column'
},
navList:{
    flexDirection:'row'
}
}
